import React from 'react';
import './css/NavigationBar.css';

function NavigationBar() {
    return (
        <ul className="navBar">
            <li><a>Home</a></li>
            <li><a>About Me</a></li>
            <li><a>Work Experience</a></li>
            <li><a>Projects</a></li>
            <li><a>Contact</a></li>
        </ul> 
    )
}

export default NavigationBar;
